    "2014-10-28T20:54:50.880386",nt"name": "folds-offshore-of-coal-oil-point-california",nt"isopen":
    false,nt"url": null,nt"notes": "This part of SIM 3302 presents data for
    folds for the geologic and geomorphic map (see sheet 10, SIM 3302) of the Offshore
    of Coal Oil Point map area, California. The vector data file is included in "Folds_OffshoreCoalOilPoint.zip,"
    which is accessible from http://pubs.usgs.gov/ds/781/OffshoreCoalOilPoint/data_catalog_OffshoreCoalOilPoint.html.
    This map area is in the Ventura Basin, in the southern part of the Western Transverse
    Ranges geologic province, which is north of the California Continental Borderland
    (Fisher and others, 2009). Significant clockwise rotation--at least 90 degrees--since
    the Miocene has been proposed for the Western Transverse Ranges province (Luyendyk
    and others, 1980; Hornafius and others, 1986; Nicholson and others, 1994), and this
    region is presently undergoing north-south shortening (see, for example, Larson
    and Webb, 1992). In the eastern part of the map area, cross sections suggest that
    this shortening is, in part, accommodated by offset on the North Channel, Red Mountain,
    South Ellwood, and More Creek Fault systems (Bartlett, 1998; Heck, 1998; Redin and
    others, 2005; Leifer and others, 2010). Crustal deformation in the western part
    of the Offshore of Coal Oil Point map area apparently is less complex than that
    in the eastern part (Redin, 2005); the western structure is dominated by a large,
    south-dipping homocline that extends from the south flank of the Santa Ynez Mountains
    beneath the continental shelf. References Cited: Bartlett, W.L., 1998, Ellwood oil
    field, Santa Barbara County, California, in Kunitomi, D.S., Hopps, T.E., and Galloway,
    J.M., eds., Structure and petroleum geology, Santa Barbara Channel, California:
    American Association of Petroleum Geologists, Pacific Section, and Coast Geological
    Society, Miscellaneous Publication 46, p. 217-237. Fisher, M.A., Sorlien, C.C.,
    and Sliter, R.W., 2009, Potential earthquake faults offshore southern California
    from the eastern Santa Barbara channel to Dana Point, in Lee, H.J., and Normark,
    W.R., eds., Earth science in the urban ocean--The Southern California Continental
    Borderland: Geological Society of America Special Paper 454, p. 271-290. Heck, R.G.,
    1998, Santa Barbara Channel regional formline map, top Monterey Formation, in Kunitomi,
    D.S., Hopps, T.E., and Galloway, J.M., eds., Structure and petroleum geology, Santa
    Barbara Channel, California: American Association of Petroleum Geologists, Pacific
    Section, and Coast Geological Society, Miscellaneous Publication 46, 1 plate. Hornafius,
    J.S., Luyendyk, B.P., Terres, R.R., and Kamerling, M.J., 1986, Timing and extent
    of Neogene rotation in the western Transverse Ranges, California: Geological Society
    of America Bulletin, v. 97, p. 1,476-1,487. Larson, K.M., and Webb, F.H., 1992,
    Deformation in the Santa Barbara Channel from GPS measurements 1987-1991: Geophysical
    News Letters, v. 19, p. 1,491-1,494. Leifer, I., Kamerling, M., Luyendyk, B.P.,
    and Wilson, D.S., 2010, Geologic control of natural marine hydrocarbon seep emissions,
    Coal Oil Point seep field, California: Geo-Marine Letters, v. 30, p. 331-338, doi:10.1007/s00367-010-0188-9.
    Luyendyk, B.P., Kamerling, M.J., and Terres, R.R., 1980, Geometric model for Neogene
    crustal rotations in southern California: Geological Society of America Bulletin,
    v. 91, p. 211-217. Nicholson, C., Sorlien, C., Atwater, T., Crowell, J.C., and Luyendyk,
    B.P., 1994, Microplate capture, rotation of the western Transverse Ranges, and initiation
    of the San Andreas transform as a low-angle fault system: Geology, v. 22, p. 491-495.
    Redin, T., 2005, Santa Barbara Channel structure and correlation sections--Correlation
    Section no. 36, N-S structure and correlation section, western Santa Ynez Mountains
    across the Santa Barbara Channel to Santa Rosa Island: American Association of Petroleum
    Geologists, Pacific Section, Publication CS 36, 1 sheet. Redin, T., Kamerling, M.,
    and Forman, J., 2005, Santa Barbara Channel structure and correlation sections--Correlation
    Section no. 35, North Ellwood-Coal Oil Point area across the Santa Barbara Channel
    to the north coast of Santa Cruz Island: American Association of Petroleum Geologists,
    Pacific Section, Publication CS 35, 1 sheet.",nt"license_title": null,nt"extras":
